To the foreign-language consumer, UniFFI object instances are designed to behave as much like regular language objects as possible. They can be freely passed as arguments or returned as values, like this: interface TodoList { ... // Copy the items from another TodoList into this one. void import_items(TodoList other); // Make a copy of this TodoList as a new instance. TodoList duplicate(); // Create a list of lists, one for each item this one sequence<TodoList> split();
}; To ensure that this is safe, UniFFI allocates every object instance on the heap using Arc , Rust's built-in smart pointer type for managing shared references at runtime. The use of Arc is transparent to the foreign-language code, but sometimes shows up in the function signatures of the underlying Rust code. When returning interface objects, UniFFI supports both Rust functions that wrap the value in an Arc<> and ones that don't. This only applies if the interface type is returned directly: impl TodoList { // When the foreign function/method returns `TodoList`, the Rust code can return either `TodoList` or `Arc<TodoList>`. fn duplicate(&self) -> TodoList { TodoList { items: RwLock::new(self.items.read().unwrap().clone()) } } // However, if TodoList is nested inside another type then `Arc<TodoList>` is required fn split(&self) -> Vec<Arc<TodoList>> { self.items.read() .iter() .map(|i| Arc::new(TodoList::from_item(i.clone())) .collect() }
} By default, object instances passed as function arguments will also be passed as an Arc<T>, so the Rust implementation of TodoList::import_items would also need to accept an Arc<TodoList>: impl TodoList { fn import_items(&self, other: Arc<TodoList>) { self.items.write().unwrap().append(other.get_items()); }
} If the Rust code does not need an owned reference to the Arc, you can use the [ByRef] UDL attribute to signal that a function accepts a borrowed reference: interface TodoList { ... // +-- indicate that we only need to borrow the other list // V void import_items([ByRef] TodoList other); ...
}; impl TodoList { // +-- don't need to care about the `Arc` here // V fn import_items(&self, other: &TodoList) { self.items.write().unwrap().append(other.get_items()); }
} Conversely, if the Rust code explicitly wants to deal with an Arc<T> in the special case of the self parameter, it can signal this using the [Self=ByArc] UDL attribute on the method: interface TodoList { ... // +-- indicate that we want the `Arc` containing `self` // V [Self=ByArc] void import_items(TodoList other); ...
}; impl TodoList { // `Arc`s everywhere! --+-----------------+ // V V fn import_items(self: Arc<Self>, other: Arc<TodoList>) { self.items.write().unwrap().append(other.get_items()); }
} You can read more about the technical details in the docs on the internal details of managing object references .

